import React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Chip from '@mui/material/Chip';
import "./CardsComp.css";

function CardsComp() {
  return (
    <div>
      <div  class="shadow-sm p-3 mb-5 bg-body-tertiary rounded">
        <Card
          sx={{
            width: "350px",
            height: "350px",
            margin: "10px",
            borderRadius: "10px",
            padding: "10px"
          }}
        >
          <CardMedia
            sx={{ height: 200, borderRadius: 5 }}
            image="https://i.pinimg.com/564x/4d/69/3b/4d693b33df231e590c8c374f9e5c0f7e.jpg"
            title="green iguana"
          />

          <CardContent>
            <div className="content d-flex justify-content-between ">
              <span id="RAV">
                <strong>Toyota RAV4 </strong>
              </span>
              <span
                className="chip"
              >
                2021
              </span>
              <Chip className="chip" label="2021" size="small" variant="outlined" />
            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}

export default CardsComp;

